import React from 'react';
import { Table, TableHead, TableRow, TableCell, TableBody } from '@mui/material';

const ReviewBalancesheet = ({balanceSheet, onClickHandler: Func, onBackClick}) => {
  return (
    <div className='balance-sheet-container'>
    <Table size="medium">
      <TableHead>
        <TableRow>
          <TableCell>Year</TableCell>
          <TableCell>Month</TableCell>
          <TableCell>Assets Value</TableCell>
          <TableCell>Profit/Loss</TableCell>
        </TableRow>
      </TableHead>
      <TableBody>
        {balanceSheet.map((data, index) => (
          <TableRow key={data.year} className={index % 2 === 0 ? 'even-row' : 'odd-row'}>
            <TableCell>{data.year}</TableCell>
            <TableCell>{data.month}</TableCell>
            <TableCell>{data.assetsValue}</TableCell>
            <TableCell>{data.profitOrLoss}</TableCell>
          </TableRow>
        ))}
      </TableBody>
    </Table>
    <div className='buttonContainer'>
      <button onClick={onBackClick}>Back</button>
      <button onClick={onClickHandler}>Submit</button>
    </div>
    </div>
  );
};
export default ReviewBalancesheet;
